import React from 'react';
import styled from 'styled-components';
import Background from './background.png';

const Container = styled.div`
  display: flex;
  flex: 1;
  height: 100%;
  align-content: center;
  justify-content: center;
`;

export default function Index() {
  return (
    <Container>
      <div>Hello</div>
    </Container>
  );
}
